import React from 'react';
import logo from './logo.svg';
import { Counter } from './features/counter/Counter';
import {
    BrowserRouter as Router,
    Route,
    Routes,
    Link
} from "react-router-dom";
import './App.css';
import ToDoUI from "./features/todos/ToDoUI";
import SignPage from "./pages/SignPage"
import DownloadPage from "./pages/DownloadPage"
import HomePage from "./pages/HomePage";
import MovieListPage from "./pages/MovieListPage";
import MovieDetailsPage from "./pages/MovieDetailsPage";
import Login_page_ from './pages/Login_Page';
import {Personal_page} from "./pages/Personal_page";
import FoodShop from "./pages/Shop_page"
import { Login } from './features/Login/LoginApi';

function App() {
  return (
    <div className="App">
     {/* <Counter />*/}
     <Router>

         <Routes>
             <Route path="/home" element={<HomePage/>}>

             </Route>
             <Route path="/movie-list" element={<MovieListPage/>}>

             </Route>
             <Route path="/movie-details/:movieId" element={<MovieDetailsPage/>}>

             </Route>
             <Route path = "/" element = {<Login_page_/>}>

             </Route>
             <Route path = "/profile" element = {<Personal_page/>}>

             </Route>
             <Route path = "/sign" element = {<SignPage/>}>

             </Route>
             <Route path = "/download" element = {<DownloadPage/>}>

             </Route>
             <Route path = "/shop" element = {<FoodShop/>}>

             </Route>
             <Route path = "/shop/shop-detail/:foodID" element = {<FoodShop/>}>

             </Route>
             {/*<Route path="/login" element={<LoginPage/>}>

             </Route>*/}
             {/*<Route path="/movie-list" element={
                 <PrivateRoute
                     redirectTo={"/login?redirectTo=/movie-list"}
                     isAuth={useAuthentication()}>
                     <MovieList />
                 </PrivateRoute>}>

             </Route>

             <Route
                 path="/movie-detail/:movieId"
                 element={
                     <PrivateRoute
                         redirectTo={"/login?redirectTo=/movie-detail/:movieId"}
                         isAuth={useAuthentication()}>
                         <MovieDetailPage />
                     </PrivateRoute>
                 }
             />
             <Route path="/logout" element={<LogoutPage/>}>

             </Route>
*/}


         </Routes>
     </Router>


      {/*  <ToDoUI/>*/}
    </div>
  );
}

export default App;
